import React from 'react';
import { ChartData } from '../utils/utils';
import {
  BarChart,
  Bar,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer
} from 'recharts';

const TranslucentBarChart: React.FC<ChartData> = ({ chartData }) => {
    return (
        <ResponsiveContainer width="100%" maxWidth={700} height={400}>
            <BarChart
                data={chartData}
                margin={{ top: 5, right: 0, left: 0, bottom: 5 }}
            >
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="department" />
                <YAxis />
                <Tooltip />
                <Legend />
                <Bar
                dataKey="count"
                fill="#8884d8"
                radius={[10, 10, 0, 0]}
                />
            </BarChart>
        </ResponsiveContainer>
    );
};

export default TranslucentBarChart;
